                <a href="#" > Cardápio </a>
                <a href="#" > Promoções </a>
                <a href="#" > Contato</a>
                <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fw7.pngwing.com%2Fpngs%2F971%2F990%2Fpng-transparent-computer-icons-login-person-user-pessoa-smiley-desktop-wallpaper-address-icon.png&imgrefurl=https%3A%2F%2Fwww.pngwing.com%2Fpt%2Ffree-png-tliwd&tbnid=7DDLjE_MGf1wjM&vet=12ahUKEwiJrOKnmbL0AhVcu5UCHXvfDTQQMygCegUIARCzAQ..i&docid=Bc8dCtvQOZD7hM&w=920&h=512&q=login%20iconpng&ved=2ahUKEwiJrOKnmbL0AhVcu5UCHXvfDTQQMygCegUIARCzAQ"></img>
            </div>
